import React from 'react';
import maintenance from "../assets/maintenance2.jpg"
import { withTranslation } from "react-i18next";

const UserPage = () => {
    const { t} = this.props;
    return (
        <div className='container'>
            <h1 className='text-center'>{t('Profile')}</h1>
            <img className='rounded mx-auto d-block' width="600" src={maintenance}  alt="Maintanence" />
        </div>
    );
};

export default withTranslation()(UserPage);
